import { ClientCardData } from '../RouteListFolder/clientCardData'


export const CompletedRoutesComponent = ({ routesCompleted,
                                            currentClientData,setCurrentClientData,
                                            showMore,
                                            setShowMore}) => {
  

    return (
        <>

          <section className = 'RoutesListContainer'>

            { routesCompleted.map( (e)=>
            
              <div key = { e.directionClient } className='clientCard'>

                <ClientCardData clientData = { e }
                                setCurrentClientData = { setCurrentClientData}
                                setShowMore = { setShowMore }/>

              </div>
            
            ) }

          </section>
          
        </>
    )    
}
